import React from 'react';
import { Link } from 'react-router-dom';
// import { useActionState } from 'react';
import { TextField, Button, Box, Typography, Container, Grid, Paper } from '@mui/material';
import { isEmail, isNotEmpty, hasMinLength } from '../../util/validation';

function loginAction(_prevFormState: unknown, formData: FormData) {
  const email = formData.get('email');
  const password = formData.get('password');

  const errors: string[] = [];

  if (email !== null &&
    (!isNotEmpty(email.toString()) || !isEmail(email.toString()))) {
    errors.push("Digite um E-mail válido");
  }

  if (password !== null &&
    (!isNotEmpty(password.toString()) || !hasMinLength(password.toString(), 6))) {
    errors.push("Senha deve ter no mínimo 6 caracteres");
  }

  if (email === null && password === null) {
    errors.push("Digite seu E-mail e Senha.");
  }

  if (errors.length > 0) {
    return {
      errors,
      enteredValues: {
        email,
        password
      }
    };
  }

  return { errors: null };
}

export const Login = () => {
  const [formState, formAction] = useActionState(loginAction, {
    errors: null
  });

  return (
    <Container component="main" maxWidth="xs">
      <Paper elevation={3} sx={{ padding: 3 }}>
        <Box display="flex" flexDirection="column" alignItems="center">
          <Typography variant="h5">Login</Typography>

          <form onSubmit={formAction}>
            <Box sx={{ marginTop: 2 }}>
              <TextField
                variant="outlined"
                fullWidth
                margin="normal"
                label="E-mail"
                name="email"
                autoComplete="username"
                defaultValue={formState.enteredValues!.email!.toString()}
                error={formState.errors!.some((err) => err.includes("E-mail"))}
                helperText={formState.errors!.find((err) => err.includes("E-mail"))}
              />
            </Box>

            <Box sx={{ marginTop: 2 }}>
              <TextField
                variant="outlined"
                fullWidth
                margin="normal"
                label="Senha"
                name="password"
                type="password"
                autoComplete="current-password"
                defaultValue={formState.enteredValues!.password!.toString()}
                error={formState.errors!.some((err) => err.includes("Senha"))}
                helperText={formState.errors!.find((err) => err.includes("Senha"))}
              />
            </Box>

            {formState.errors && (
              <Box sx={{ marginTop: 2 }}>
                <ul style={{ color: 'red' }}>
                  {formState.errors.map((error, index) => (
                    <li key={index}>{error}</li>
                  ))}
                </ul>
              </Box>
            )}

            <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: 2 }}>
              <Button type="submit" variant="contained" color="primary" fullWidth sx={{ marginBottom: 2 }}>
                Entrar
              </Button>
              <Button variant="outlined" color="secondary" fullWidth type="reset">
                Limpar
              </Button>
            </Box>
          </form>

          <Box sx={{ marginTop: 2 }}>
            <Typography variant="body2" align="center">
              <Link to="/rescuePassword" style={{ textDecoration: 'underline' }}>Esqueceu a senha?</Link>
            </Typography>
          </Box>

          <Box sx={{ marginTop: 2 }}>
            <Typography variant="body2" align="center">
              Não tem conta? <Link to="/signup" style={{ textDecoration: 'underline' }}>Cadastre-se</Link>
            </Typography>
          </Box>
        </Box>
      </Paper>
    </Container>
  );
};
